INTERNATIONAL PAPER COMPANY
RATE SCHEDULE FOR WHOLESALE POWER SALES AT MARKET BASED RATES

INTERNATIONAL PAPER COMPANY
RATE SCHEDULE FOR WHOLESALE POWER SALES 
AT MARKET BASED RATES
1. Availability: International Paper Company ("Seller") makes electric energy and capacity available under this FERC Electric Rate Tariff to any entity that purchases power and energy for resale subject to the Federal Energy Regulatory Commission's jurisdiction. Seller also makes available to any purchaser the ancillary services listed in this Paragraph 1:
a.	NYISO: Seller offers regulation and frequency response service, and operating reserve service (which includes 10-minute nonsynchronous, 30-minute operating reserves, 10-minute spinning reserves, and 10-minute non-spinning reserves) for sale to purchasers in the market administered by the New York Independent System Operator, Inc.
b.	New England: Seller offers regulation and frequency response service (automatic generator control), operating reserve service (which includes 10-minute spinning reserve, 10-minute non-spinning reserve, and 30-minute operating reserve service) to purchasers within the markets administered by the ISO New England, Inc.
c.	PJM: Seller offers regulation and frequency response service, energy imbalance service, and operating reserve service (which includes spinning, 10-minute, and 30-minute reserves) for sale into the market administered by PJM Interconnection, L.L.C. ("PJM") and, where the PJM Open Access Transmission Tariff permits, the self-supply of these services to purchasers for a bilateral sale that is used to satisfy the ancillary services requirements of the PJM Office of Interconnection.
d.	California: Seller offers regulation service, spinning reserve service, and non-spinning reserve service to the California Independent System Operator Corporation ("CAISO") and to others that are self-supplying ancillary services to the CAISO. 
e.	MISO: Seller offers regulation service and operating reserve service (which includes 10-minute spinning reserve and 10-minute supplemental reserve) for sale to the Midcontinent Independent System Operator, Inc. ("MISO") and to others that are self-supplying ancillary services to MISO.
f.	Southwest Power Pool: Seller offers regulation service and operating reserve service (which includes 10-minute spinning reserve and 10-minute supplemental reserve) for sale to the Southwest Power Pool, Inc. ("SPP") and to others that are self-supplying ancillary services to SPP.
g.	Third-party ancillary services: Seller offers Regulation Service, Reactive Supply and Voltage Control Service, Energy and Generator Imbalance Service, Operating Reserve-Spinning, and Operating Reserve-Supplemental, and Primary Frequency Response Service. Sales will not include the following: (1) sales to an RTO or an ISO, i.e., where that entity has no ability to self-supply ancillary services but instead depends on third parties; and (2) sales to a traditional, franchised public utility affiliated with the third-party supplier, or sales where the underlying transmission service is on the system of the public utility affiliated with the third-party supplier. Sales of Operating Reserve-Spinning and Operating Reserve-Supplemental will not include sales to a public utility that is purchasing ancillary services to satisfy its own open access transmission tariff requirements to offer ancillary services to its own customers, except where the Commission has granted authorization. Sales of Regulation Service, Reactive Supply and Voltage Control Service will not include sales to a public utility that is purchasing ancillary services to satisfy its own open access transmission tariff requirements to offer ancillary services to its own customers, except at rates not to exceed the buying public utility transmission provider's OATT rate for the same service or where the Commission has granted authorization.

2. Applicability: This Tariff is applicable to all sales of energy or capacity by Seller which are (a) subject to the jurisdiction of the Federal Energy Regulatory Commission ("Commission") and (b) are not made pursuant to a particular tariff on file with the Commission.
3. Rates: All sales shall be made at rates established by agreement between the purchaser and Seller.
4. Other Terms and Conditions: All other terms and conditions shall be established by agreement between purchaser and Seller.
5. Compliance with Commission Regulations: Seller shall comply with the provisions of 18 CFR Part 35, Subpart H, as applicable, and with any conditions the Commission imposes in its orders concerning seller's market-based rate authority, including orders in which the Commission authorizes seller to engage in affiliate sales under this Tariff or otherwise restricts or limits the seller's market-based rate authority. Failure to comply with the applicable provisions of 18 CFR Part 35, Subpart H, and with any orders of the Commission concerning seller's market-based rate authority, will constitute a violation of this Tariff.

6. Limitations and Exemptions: Seller's market-based rate authority under this Tariff is subject to the following waivers granted by the Commission by Order, International Paper Co,, Docket No. ER06-1364-000, at 2 (Sept. 19, 2006) (unpublished letter order): waiver of Subparts B and C of Part 35 of the Commission's regulations requiring the filing of cost-of-service information, except for sections 35.12(a), 35.13(b), 35.15 and 35.16; waiver of Part 41, Part 101, and Part 141 of the Commission's regulations concerning accounting and reporting requirements, with the exception of 18 C.F.R. 141.14 and 141.15; and blanket authorization under Part 34 of the Commission's regulations to issue securities and assume obligations or liabilities as guarantor, indorser, surety, or otherwise in respect of any security of another person; provided that such issue or assumption is for some lawful object within the corporate purposes of Seller, compatible with the public interest, and reasonably necessary or appropriate for such purposes.
Certain sales of energy, capacity and ancillary services by Seller are made pursuant to state regulatory authorities' implementation of section 210 of PURPA in Florida, Georgia, and South Carolina, which, under 18 C.F.R. 292.601(c)(1), are exempt from Section 205 of the Federal Power Act. The Commission orders and certifications and re-certifications for Seller's QF status are as follows:
