7. Seller Category: Seller is a Category 1 seller in the Northeast, Northwest, Southeast, Central, Southwest Power Pool, and Southwest regions, as defined in 18 CFR 35.36(a).
Effective Date: This Tariff is effective upon the date authorized by the Federal Energy Regulatory Commission.




